import axios from 'axios';

const BASE_URL = 'http://localhost:3001/login'; 

const UserService = {
  login: async (userData) => {
    try {
      const response = await axios.post(`${BASE_URL}/login`, userData);
      return response.data;
    } catch (error) {
      throw error;
    }
  },
};

export default UserService;
